export default function Home(props){
    return( 
        props.movie.filter((mov)=>{
            return mov.Genre==='Drama'
        }).map((mov,i)=>{
            <div key={i}>
                <p>{mov.Title}</p>
                <img src={mov.Image} />
            </div>
        })
    )
}
